import { Button, Container } from 'react-bootstrap';

const Admin = () => {
    return (
        <Container>
            <Button>Добавить тип</Button>
            <Button>Добавить бренд</Button>
            <Button>Добавить устройства</Button>
        </Container>
    );
};

export default Admin;
